import React, { Component } from 'react';
import './App.css';
import NavBar from './Components/NavBar/NavBar'

class App extends Component {

  state = {
    currentPage: null,
    word: "Test"
  }

  changeWord(props) {

    this.setState({
      word: props.word
    })

  }



  render() {
    return (
      <div>
        <h1>ryan slevin</h1>
        <NavBar handleClick={this.changeWord.bind(this)}/>
        <p>{this.state.word}</p>
      </div>
    );

  }

}

export default App;
